import css from './ImageGallery.module.css';

export default ImageGalleryItem = ({ image, tags, id, largeImage }) => {
  return (
    <li class={css.photo}>
      <img id={id} src={image} alt={tags} largeImage={largeImage} />
    </li>
  );
};
